/* _optimizely_evaluate=force */
window.EXP = window.EXP || {};
$ = $ || jQuery;
utils = window.optimizely.get("utils");


EXP.bxpsci260 = (function() {

    init = function() {
        if($.trim(window.location.pathname).match('/try/cloud/signup')){
           console.log("here-added");
           utils.waitUntil(function() {
              var submitButton = document.querySelectorAll('form .submit button');
              return submitButton && submitButton.length > 0;
            }).then(function(){
              console.log("In then!!");
              addEventHandler();
            });
        }
    },
    addCookies = function() {
        console.log("in add cookies");
        addUserId();
        // addCohorts();
        // addSegments();
    },
    getCookie = function (name) {
      var value = document.cookie.match('(^|;) ?' + name + '=([^;]*)(;|$)');
      return value ? decodeURIComponent(value[2]) : null;
    },
    addUserId = function() {
        var existingId = getExistingCookie('optimizelyEndUserId', false),
            userId = optimizely.get('visitor_id').randomId;

            console.log('Existing Id: ' + existingId);

        if(userId) {
            console.log('X userId:' + userId);
            // setCookie('optimizelyEndUserId', userId);
        }
    },
    getExistingCookie = function(cookieName, isObj) {
        var cookie = getCookie(cookieName);

        if(cookie) {
            if(isObj) {
                cookie = JSON.parse(cookie);
            }
        } else {
            if(isObj) {
                cookie = {};
            }
        }
        return cookie;
    },
    addEventHandler = function() {
        jQuery('form .submit button').on('click', function(submitevent) {
            addCookies();
       });
    };
    return {
        'init': init
    };
})();

$(document).ready(function() {
    EXP.bxpsci260.init();
});

