    modifyPricingCalculator = function() {
        var calc = '',
            calc_heading = '',
            $link = '',
            $averageLabel = $('.imkt-pup-calculator__average-label');

        //CALCUTLATOR STRUCTURE IS THE SAME ON ALL 3, except for the try button
        $('.imkt-pup-calculator__result').children().wrapAll('<div class="results-inner"></div>');
        $('.imkt-pup-calculator').parent().removeClass('column-lg-4 column-md-6').addClass('column-lg-8 column-md-10 column-xs-10 column-xs-offset-1');
        $('.imkt-pup-calculator').parent().parent().addClass('calculator');
        $('.imkt-pup-calculator').parent().parent().parent().addClass('cloud-ia');

        $('.imkt-pup-calculator__calculation form input').parent().addClass('input-field');

        $('.imkt-pup-calculator__user-input').focusout(function(){
            tracking.sendTrack('calculatorValue', {
                'calculatorValue': jQuery('.imkt-pup-calculator__user-input').val()
            });
        });

        //HOW MUCH DOES IT COST
        $('.calculator .component--heading h2').text('How much does it cost?');
        $('.calculator .component--heading').addClass('calc-header');
        $('<p>Get any sized team started free for 7 days. No credit card needed.</p>').appendTo($('.calculator .component--heading h2').parent());

        //JUMP TO ANNUAL PRICING
        $('.annual-pricing .jump-to-annual').click(function(){
            jumpToFAQ(jQuery('.faq-item.annual-sub'));
        });


        //TRY BUTTON
        insertTryButton();

        //WHAT IS A USER?
        $('.imkt-pup-calculator__heading').next().addClass('subheading');
        insertWhatUser();

        //SHOW BREAKDOWN
        $('<div class="breakdown closed show">Show me the breakdown</div><div class="breakdown-calc">Flat monthly rate</div>').insertAfter($('.imkt-tab-block:first .imkt-pup-calculator__price-label'));
        addUserInputEvent();

        $('.breakdown').click(function(e){
            $link = $(e.target);
            if($link.hasClass('closed')) {
                $link.removeClass('closed');
                $link.text('Hide the breakdown');
                $('.breakdown-calc').addClass('show');
            } else {
                $link.addClass('closed');
                $link.text('Show the breakdown');
                $('.breakdown-calc').removeClass('show');
            }
        });

        //DETACH MODIFIED CALCULATOR AND HEADER, EMPTY BUCKETS, REAPPEND
        calc = $('.imkt-pup-calculator').detach();
        calc_heading = $('.calculator .component--heading').parent();

        $('.block-one').empty();
        $('.block-two').empty();

        if(opt === 'jsd'){
            $('.block-three').empty();
            $('.block-four').empty();
        }

        $('.block-one').append(calc_heading);
        $('.calc-header').append(calc);
        $('<div class="annual-pricing"><a href="https://www.atlassian.com/licensing/cloud#managingyourannualsubscription-2" class="jump-to-annual">Interested in annual pricing?</a></div>').insertAfter($('.imkt-pup-calculator '));

        //SET DEFAULT VALUES
        setDefaultValues();
    },
