    calculateBreakdown = function(){
        var users = $('.imkt-pup-calculator__user-input').val(),
            returnVal = '';

        if(opt === 'jsw'){
            // up to 10 users
            if(users <= 10) {
                return 'Flat monthly fee';
            }



            // first 100 - $7 / user
            if(users <= 100) {
                return '(' + users + ' x $7)';
            } else {
                returnVal = '(100 x $7)';
                users = users - 100;
            }

            // next 150 - $4 / user
            if(users <= 150){
                return returnVal + ' + (' + users + ' x $4)';
            } else {
                returnVal += ' + (150 x $4)';
                users = users - 150;
            }

            // each addition after 250 - $1 / user
            return returnVal += ' + (' + users + ' x $1)';
        }else {
            if(opt === 'con'){
                // up to 10 users
                if(users <= 10) {
                    return 'Flat monthly fee';
                }

                // first 100 - $5 / user
                if(users <= 100) {
                    return '(' + users + ' x $5)';
                } else {
                    returnVal = '(100 x $5)';
                    users = users - 100;
                }

                // next 150 - $3 / user
                if(users <= 150){
                    return returnVal + ' + (' + users + ' x $3.50)';
                } else {
                    returnVal += ' + (150 x $3.50)';
                    users = users - 150;
                }

                // each addition after 250 - $1 / user
                return returnVal += ' + (' + users + ' x $1.10)';
            }else {
                if(opt === 'jsd'){
                    // up to 10 users
                    if(users <= 3) {
                        return 'Flat monthly fee';
                    }

                    // first 15 - $20 / agent
                    if(users <= 15) {
                        return '(' + users + ' x $20)';
                    } else {
                        returnVal = '(15 x $20)';
                        users = users - 15;
                    }

                    // next 85 - $15 / agent
                    if(users <= 85) {
                        return returnVal + ' + (' + users + ' x $15)';
                    } else {
                        returnVal += ' + (85 x $15)';
                        users = users - 85;
                    }

                    // next 150 - $8 / agent
                    if(users <= 150){
                        return returnVal + ' + (' + users + ' x $8)';
                    } else {
                        returnVal += ' + (150 x $8)';
                        users = users - 150;
                    }

                    // each addition after 250 - $1 / user
                    return returnVal += ' + (' + users + ' x $1)';
                }
            }
        }

    };
